import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the shopping cart element
    const cartLocator = page.locator('div.cart');
    await cartLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Extract the text from the cart element before clicking
    const cartText = (await cartLocator.textContent()).trim();

    // Click the cart element to trigger the modal
    await cartLocator.click();

    // Take a screenshot after the click action
    // Note: In a dynamic application, this would show the opened modal.
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_clicked.png'));

    return {
      success: true,
      action: "Clicked on the shopping cart element.",
      extractedData: {
        cartElementText: cartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
